import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { toast } from 'react-toastify';

export default function Analytics() {
  const [analytics, setAnalytics] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchAnalytics();
  }, []);

  const fetchAnalytics = async () => {
    try {
      const token = localStorage.getItem('token');
      const res = await axios.get(`${process.env.REACT_APP_API_URL}/api/user/analytics`, {
        headers: {
          'x-auth-token': token,
        },
      });
      setAnalytics(res.data);
      setLoading(false);
    } catch (err) {
      toast.error('Failed to fetch analytics');
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-600"></div>
      </div>
    );
  }

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <h1 className="text-2xl font-bold text-gray-900 mb-8">Reading Analytics</h1>

      <div className="grid grid-cols-1 gap-6 sm:grid-cols-2 lg:grid-cols-3">
        {/* Reading Stats */}
        <div className="bg-white rounded-lg shadow-md p-6">
          <h2 className="text-lg font-medium text-gray-900 mb-4">Reading Statistics</h2>
          <div className="space-y-4">
            <div>
              <p className="text-sm text-gray-500">Total Articles Read</p>
              <p className="text-2xl font-semibold text-gray-900">{analytics?.totalArticlesRead || 0}</p>
            </div>
            <div>
              <p className="text-sm text-gray-500">Average Reading Time</p>
              <p className="text-2xl font-semibold text-gray-900">{analytics?.avgReadingTime || 0} min</p>
            </div>
            <div>
              <p className="text-sm text-gray-500">Articles Saved</p>
              <p className="text-2xl font-semibold text-gray-900">{analytics?.savedArticles || 0}</p>
            </div>
          </div>
        </div>

        {/* Topic Preferences */}
        <div className="bg-white rounded-lg shadow-md p-6">
          <h2 className="text-lg font-medium text-gray-900 mb-4">Topic Preferences</h2>
          <div className="space-y-4">
            {analytics?.topicPreferences?.map((topic) => (
              <div key={topic.name} className="flex justify-between items-center">
                <span className="text-sm text-gray-600">{topic.name}</span>
                <span className="text-sm font-medium text-gray-900">{topic.count} articles</span>
              </div>
            ))}
          </div>
        </div>

        {/* Reading History */}
        <div className="bg-white rounded-lg shadow-md p-6">
          <h2 className="text-lg font-medium text-gray-900 mb-4">Recent Activity</h2>
          <div className="space-y-4">
            {analytics?.recentActivity?.map((activity) => (
              <div key={activity._id} className="flex justify-between items-center">
                <div>
                  <p className="text-sm font-medium text-gray-900">{activity.title}</p>
                  <p className="text-xs text-gray-500">{new Date(activity.date).toLocaleDateString()}</p>
                </div>
                <span className="text-sm text-gray-600">{activity.type}</span>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Reading Insights */}
      <div className="mt-8 bg-white rounded-lg shadow-md p-6">
        <h2 className="text-lg font-medium text-gray-900 mb-4">Reading Insights</h2>
        <div className="space-y-4">
          {analytics?.insights?.map((insight, index) => (
            <div key={index} className="flex items-start">
              <div className="flex-shrink-0">
                <div className="h-8 w-8 rounded-full bg-primary-100 flex items-center justify-center">
                  <span className="text-primary-600 text-sm font-medium">{index + 1}</span>
                </div>
              </div>
              <div className="ml-4">
                <p className="text-sm text-gray-900">{insight}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
